description:
The Tea Party - Live: Intimate &amp; Interactive (2007) is a single digital versatile disc (DVD) by the Canadian rock band The Tea Party. The live music DVD is the only official live video release, shot in the MuchMusic CHUM-City Building in Toronto, during their Intimate and Interactive performance in May 1998, coupled with a performance from 20 November 2000.

Track listing:

Intimate &amp; Interactive (1998)

    01 &quot;Army Ants&quot;
    02 &quot;Fire in the Head&quot;
    03 &quot;Release&quot;
    04 &quot;Transmission&quot;
    05 &quot;Save Me&quot;
    06 &quot;Sister Awake&quot;
    07 &quot;Temptation&quot;
    08 &quot;Psychopomp&quot;

Live @ Much (2000)

    09 &quot;Temptation&quot;
    10 &quot;The Messenger&quot;
    11 &quot;Sister Awake&quot;

